AxB, also known as the Cartesian product of A and B, is the set of all ordered pairs (a, b) where a is in A and b is in B. 

AxB = {(1, 3), (1, 4), (2, 3), (2, 4)}

BxA, also known as the Cartesian product of B and A, is the set of all ordered pairs (b, a) where b is in B and a is in A.

BxA = {(3, 1), (3, 2), (4, 1), (4, 2)}

AxB and BxA are not equal because the ordered pairs in each set are different. In AxB, the first element of each pair comes from set A, while in BxA, the first element of each pair comes from set B.
